      Genre       :    Comedy | Drama | Family  


 Karam Singh Sandhu is the modern patriarch     
 of the Sandhu Group of Companies. He lives     
 with his two sons , Sukhdeep and Rajbir .      
 While Sukhdeep looks after the business,       
 Rajbir is the pampered one. Kang is the fun    
 loving librarian, who has not worked a day     
 in his life, but has to work extra hard to     
 convince his ladyloves' eccentric family that  
 he possesses all the qualities they want in    
 their would be son-in-law. Sukhdeep meets Aman 
 and both fall in love with each other. When    
 the time comes for Sukhdeep to propose to Aman,
 her past resurfaces. Karam Singh arranges the  
 marriage of Sukhdeep to Harleen and then later 
 finds out that he has arranged his elder son   
 to marry the girl his younger son loves.       



